// src/App.js
import React from 'react';
import Header from './Header';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects';
import Courses from './Courses';
import './App.css';

function App() {
    return (
        <div className="App">
            <Header />
            <PersonalInfo />
            <Projects />
            <Courses />
        </div>
    );
}

export default App;
